Step 1: Identify the three items from the financial statements.

• From the Balance Sheet, we need the capital contributed by shareholders in exchange for shares. That is the “Paid-in Capital” end value, which is 28000000.00.
• From the Income Statement, we need the profit or loss for the period before deducting tax expense. That is the “Profit Before Tax”, which is 2154033.87.
• From the Cash Flow Statement, we need the addition in the amount owed by the entity for goods or services received or purchased on credit. That is the “Increase (Decrease) in Accounts Payable” value, which is 1000000.00.

